import React from 'react';
import './App.css';
import Pod from  './components/Rooms.jsx';

export default class App extends React.Component {
  render(){
    return(
      <div className="floor">
        <div className = "left-wing">
          <div className="side">
            <Pod className="pod"/>
            <Pod className="pod"/>
          </div>
          <div className="side">
          <Pod className="pod"/>
          <Pod className="pod"/>
        </div>
      </div>
      <div className = "wing">
          <div className="side">
            <Pod className="pod"/>
            <Pod className="pod"/>
          </div>
          <div className="side">
          <Pod className="pod"/>
          <Pod className="pod"/>
        </div>
      </div>
     </div>

    );
  }
}
